const uniqueCities = new Map<string, Location>();

[
  ...australianCities,
  ...additionalCities,
  ...newSouthWalesCities,
  ...victoriaCities,
  ...queenslandCities,
  ...westernAustraliaCities,
  ...southAustraliaCities,
  ...tasmaniaCities,
  ...actCities,
  ...ntCities
].forEach(city => {
  if (!uniqueCities.has(city.id)) {
    uniqueCities.set(city.id, city);
  }
});

export const allAustralianCities: Location[] = Array.from(uniqueCities.values());
